import Backdrop from "./Backdrop";
import Card from "./Card";
import CssBaseline from "./CssBaseline";
import Link from "./Link";
import Paper from "./Paper";


function customizeComponents(theme) {
  return {
    ...Link(theme),
    ...Card(theme),
    ...Paper(theme),
    // ...Backdrop(theme),
    ...CssBaseline(theme),
   
  };
}
export default customizeComponents;
